// MyProjects.js
import React from 'react';

const MyProjects = () => {
  return (
    <>
        <TopNav />
        <div className="container-fluid">
          <div className="row">
            <SideNav />
            <main className="col-md-9 ms-sm-auto col-lg-10 px-md-4 bg-white text-dark">
       <h1>Projects</h1>
            </main>
          </div>
        </div>
        <Footer />
      </>
  );
};

export default MyProjects;
